import styled from "styled-components";

const Container = styled.div`
margin: 5px;
padding-bottom: 20px;
align-items: center;
background-color: #3a0850;
color: beige;
border-radius: 8%;
width:30%;
height: 40%;
`;

const Buttons = styled.button`
  border-radius: 5px;
  margin: 10px;
  padding: 5px;
`;
export default function Card(props) {
  return (
    <Container>
      <button
        onClick={() => {props.onClose();}}>X</button>
      <h2>{props.name}</h2>
      <h2>{props.status}</h2>
      <h2>{props.species}</h2>
      <h2>{props.gender}</h2>
      <h2>{props.origin}</h2>
      <img src={props.image} alt="" />
    </Container>
  );
}
